const axios = require('axios')

const getCoffeeShopImage = (photo_reference) => {
    axios.get("/coffee_shop_image", {
        photo_reference
    }).then( res => 
        console.log(res.data)    
    )
}

module.exports = { getCoffeeShopImage }
